import React from "react";
import "../App";

function Header() {
  return (
    <div className="container-fluid">
      <ol class="navbar sticky-top" id="navbar">
        <li class="nav-item">
          <a class="nav-link active" href="/" class="navs">
            Clicky Game{" "}
          </a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#" class="navs">
            Correct or Incorrect{" "}
          </a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#" class="navs">
          Score: {props.score} Highscore: {props.highscore}

          </a>
        </li>
      </ol>
      <div className="jumbotron" id="info">
        <h1>Clicky Game!</h1>
        <p>
          Click on an image to earn points, but don't click on any more than
          once!
        </p>
      </div>
    </div>
  );
}

export default Header;
